import React, { Component } from "react";
import AxiosFunction from "../../Functions/AxiosFunctions";
import RowTable from "./RowFavoritesTable";

export default class FavoritesTable extends Component {
  state = { favorite_items: "" };

  async test(){
      await AxiosFunction.get_favorite().then((list)=>{this.setState({ favorite_items: list.data.express })})
  }

  render() {
    this.test();
    const favorite_items = this.state.favorite_items
    return (
      <div>
        <h2>{this.props.name}</h2>
        {favorite_items?console.log(favorite_items):console.log('loading' )}
     
      </div>
    )
  }
}
